long_desc.thetext:
org.eclipse.jdt.core.tests.compiler.regression.MethodVerifyTest.test037()
looks fishy to me:

The relevant classes are:

public abstract class X implements I, J { }
abstract class Y implements J, I { }
interface I { void foo(A a); }
interface J { void foo(A<String> a); }
class A<T> {}

In 1.7+ this signals

--------
1. ERROR in X.java (at line 2)
	abstract class Y implements J, I { }
	               ^
Name clash: The method foo(A<String>) of type J has the same erasure as foo(A) of type I but does not override it
--------

but against the structurally equivalent class X nothing is complained.

Indeed just swapping I, J vs. J, I makes the error come or disappear.

I can't recall any part in the JLS where the order of an implements list would make a difference. Am I missing anything?


This issue is relevant for current work on analyzing overriding in the presence of default methods (bug 388739 and friends): To account for the fact that any super interface can contribute an implementation I'm currently experimenting with performing a topological sort on all super interfaces, which seems to work pretty well for bug 388739, but it obviously stirs every part of the test suite that implicitly depends on any ordering that is not semantically backed.
